import axios from "axios"


export default async function fetchTodos(dispatch, getState) {

    return (dispatch) => {

  axios.get('/user?ID=12345')
  .then(function (response) {
    // handle success
    console.log(response);
  })
  .catch(function (error) {
    // handle error
    console.log(error);
  })
  .then(function () {
    // always executed
  });
    }



  }
